import { useEffect, useState } from 'react'

export const ContactNotice = () => {


    const [contact, setContacted] = useState({
        contacted: false
    })

    useEffect(() => { 
        fetch('http://localhost:8088/requests?_expand=genre&_sort=startDate', {
            method: "PUT", 
            headers: { 

            }
        })
            .then(response => response.json())
            .then(contactInfo => { 
                setContacted(contactInfo)
            })
    }, []
    )


    return (
        <>
            <label>Email sent?</label> 
            <input
                type="checkbox" 
                value={contact.contacted}
                onChange={
                    (event) => { 
                        const copy = {...contact}
                        copy.contacted = event.target.checked
                        setContacted(copy)
                    }
                }/>
        </>
    )
}
